 (12,'Dumbbell Shrug','\n        <p>\n        </p><p></p><ol><li>Stand erect with a dumbbell on each hand (palms facing your torso), arms extended on the sides.</li>\r\n\r\n<li>Lift the dumbbells by elevating the shoulders as high as possible while you exhale. Hold the contraction at the top for a second. <strong>Tip:</strong> The arms should remain extended at all times.  Refrain from using the biceps to help lift the dumbbells.  Only the shoulders should be moving up and down.</li>\r\n\r\n<li>Lower the dumbbells back to the original position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can perform this exercise with bands, barbells or cables.  You can also use a single handle and work one side at a time.\r\n</p>\n    \n',2,89,90,5,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-shrug',1,'8.6',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/96/Male/m/96_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/96/Male/m/96_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/96/Female/m/96_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/96/Female/m/96_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
