 (16,'Barbell Shrug Behind The Back','\n        <p>\n        </p><p></p><ol><li>Stand up straight with your feet at shoulder width as you hold a barbell with both hands behind your back using a pronated grip (palms facing back).  Tip: Your hands should be a little wider than shoulder width apart. You can use wrist wraps for this exercise for better grip. This will be your starting position.</li>\r\n\r\n<li>Raise your shoulders up as far as you can go as you breathe out and hold the contraction for a second.  Tip: Refrain from trying to lift the barbell by using your biceps.  The arms should remain stretched out at all times.</li>\r\n\r\n<li>Slowly return to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also rotate your shoulders as you go up, going in a semicircular motion from rear to front. However this version is not good for people with shoulder problems.  In addition, this exercise can be performed with the barbell in front of your thighs, with dumbbells by the side, a smith machine or with a shrug machine.</p>\r\n\n    \n',2,81,82,1,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-shrug-behind-the-back',1,'8.1',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/216/Male/m/216_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/216/Male/m/216_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/216/Female/m/216_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/216/Female/m/216_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
