 (69,'Isometric Neck Exercise - Front And Back','\n        <p>\n        </p><p></p><ol><li> With your head and neck in a neutral position (normal position with head erect facing forward), place both of your hands on the front side of your head.</li>\r\n\r\n	<li> Now gently push forward as you contract the neck muscles but resisting any movement of your head.  Start with slow tension and increase slowly.  Keep breathing normally as you execute this contraction.</li>\r\n\r\n	<li> Hold for the recommended number of seconds.</li>\r\n\r\n	<li> Now release the tension slowly.</li>\r\n\r\n	<li> Rest for the recommended amount of time and repeat with your hands placed on the back side of your head.</li>\r\n</ol><p><strong>Variations:</strong> You can also do this exercise by placing your hands on the sides of your head.  First do one side and then the next.</p>\n    \n',1,367,368,0,2,68,'http://www.bodybuilding.com/exercises/detail/view/name/isometric-neck-exercise-front-and-back',1,'6.2',3,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Male/m/27_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Male/m/27_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Female/m/27_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Female/m/27_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (70,'Isometric Neck Exercise - Sides','\n        <p>\n        </p><p></p><ol><li> With your head and neck in a neutral position (normal position with head erect facing forward), place your left hand on the left side of your head.</li>\r\n\r\n	<li> Now gently push towards the left as you contract the left neck muscles but resisting any movement of your head.  Start with slow tension and increase slowly.  Keep breathing normally as you execute this contraction.</li>\r\n\r\n	<li> Hold for the recommended number of seconds.</li>\r\n\r\n	<li> Now release the tension slowly.</li>\r\n\r\n	<li> Rest for the recommended amount of time and repeat with your right hand placed on the right side of your head.</li>\r\n</ol><p><strong>Variations:</strong> You can also do this exercise by placing your hands to the front and then to the back of your head.  First do one side and then the next.</p>\n    \n',1,369,370,1,2,68,'http://www.bodybuilding.com/exercises/detail/view/name/isometric-neck-exercise-sides',1,'6.8',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Male/m/28_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Male/m/28_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Female/m/28_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Female/m/28_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (71,'Lying Face Down Plate Neck Resistance','\n        <p>\n        </p><p></p><ol><li> Lie face down with your whole body straight on a flat bench while holding a weight plate behind your head.  <strong>Tip:</strong> You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the upper chest, neck and face to be off the bench.  This will be your starting position.</li>\r\n\r\n	<li> While keeping the plate secure on the back of your head slowly lower your head (as in saying \"yes\") as you breathe in.</li>\r\n\r\n	<li> Raise your head back up to the starting position in a semi-circular motion as you breathe out.  Hold the contraction for a second.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> As with all exercises, refrain from using any sort of sudden or jerking motions.</p>\r\n\r\n<p><strong>Variation:</strong> You can opt to use no resistance at first.</p>\n    \n',1,73,74,0,2,51,'http://www.bodybuilding.com/exercises/detail/view/name/lying-face-down-plate-neck-resistance',1,'9.1',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Male/m/25_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Male/m/25_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Female/m/25_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Female/m/25_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (72,'Lying Face Up Plate Neck Resistance','\n        <p>\n        </p><p></p><ol><li> Lie face up with your whole body straight on a flat bench while holding a weight plate on top of your forehead.  <strong>Tip:</strong> You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the traps, neck and head to be off the bench.  This will be your starting position.</li>\r\n\r\n	<li> While keeping the plate secure on your forehead slowly lower your head back in a semi-circular motion as you breathe in.</li>\r\n\r\n	<li> Raise your head back up to the starting position in a semi-circular motion as you breathe out.  Hold the contraction for a second.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> As with all exercises, refrain from using any sort of sudden or jerking motions.</p>\r\n\r\n<p><strong>Variation:</strong> You can opt to use no resistance at first.</p>\n    \n',1,75,76,1,2,51,'http://www.bodybuilding.com/exercises/detail/view/name/lying-face-up-plate-neck-resistance',1,'8.1',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Male/m/26_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Male/m/26_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Female/m/26_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Female/m/26_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (73,'Chin To Chest Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Get into a seated position on the floor.</li>\r\n<li> Place both hands at the rear of your head, fingers interlocked, thumbs pointing down and elbows pointing straight ahead. Slowly pull your head down to your chest. Hold for 20-30 seconds. </li>\r\n</ol>\n',1,333,334,0,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/chin-to-chest-stretch',3,'3.6',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Male/m/467_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Male/m/467_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Female/m/467_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Female/m/467_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (74,'Neck-SMR','\n        <p>\n        </p><p>\r\n</p><ol><li>Using a muscle roller or a rolling pin, place the roller behind your head and against your neck. Make sure that you do not place the roller directly against the spine, but turned slightly so that the roller is pressed against the muscles to either side of the spine. This will be your starting position.</li>\r\n<li> Starting at the top of your neck, slowly roll down the muscles of your neck, pausing at points of tension for 10-30 seconds. </li>\r\n</ol>\n',1,335,336,1,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/neck-smr',3,'2.3',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Male/m/628_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Male/m/628_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Female/m/628_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Female/m/628_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (75,'Side Neck Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Start with your shoulders relaxed, gently tilt your head towards your shoulder.</li>\r\n<li> Assist stretch with a gentle pull on the side of the head.</li>\r\n</ol>\n',1,337,338,2,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/side-neck-stretch',1,'4.7',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Male/m/447_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Male/m/447_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (76,'Traps','',1,340,341,1,1,24,'',0,'0.0',0,0,NULL,NULL),
 (77,'Traps','',1,372,373,1,1,66,'',0,'0.0',0,0,NULL,NULL),
 (78,'Barbell Shrug','        <p>\r\n        </p><p></p><ol><li>Stand up straight with your feet at shoulder width as you hold a barbell with both hands in front of you using a pronated grip (palms facing the thighs).  Tip: Your hands should be a little wider than shoulder width apart.  You can use wrist wraps for this exercise for a better grip. This will be your starting position.</li>\r\n\r\n<li>Raise your shoulders up as far as you can go as you breathe out and hold the contraction for a second.  Tip: Refrain from trying to lift the barbell by using your biceps.  </li>\r\n\r\n<li>Slowly return to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also rotate your shoulders as you go up, going in a semicircular motion from front to rear. However this version is not good for people with shoulder problems.  In addition, this exercise can be performed with the barbell behind the back, with dumbbells by the side, a smith machine or with a shrug machine.</p>\r\n\r\n    \r\n',1,79,80,0,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-shrug',1,'8.1',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Male/m/97_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Male/m/97_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Female/m/97_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Female/m/97_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (79,'Cable Shrugs','\n        <p>\n        </p><p></p><ol><li> Grasp a cable bar attachment that is attached to a low pulley with a shoulder width or slightly wider overhand (palms facing down) grip.</li>\r\n\r\n	<li> Stand erect close to the pulley with your arms extended in front of you holding the bar. This will be your starting position.</li>\r\n\r\n	<li> Lift the bar by elevating the shoulders as high as possible as you exhale. Hold the contraction at the top for a second. <strong>Tip:</strong> The arms should remain extended at all times.  Refrain from using the biceps to help lift the bar.  Only the shoulders should be moving up and down.</li>\r\n\r\n	<li> Lower the bar back to the original position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with bands, barbells or dumbbell.  You can also use a single handle and work one side at a time.</p>\n    \n',1,83,84,2,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/cable-shrugs',1,'8.3',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Male/m/133_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Male/m/133_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Female/m/133_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Female/m/133_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (80,'Calf-Machine Shoulder Shrug','\n        <p>\n        </p><p></p><ol><li> Position yourself on the calf machine so that the shoulder pads are above your shoulders. Your torso should be straight with the arms extended normally by your side. This will be your starting position.</li>\r\n\r\n	<li> Raise your shoulders up towards your ears as you exhale and hold the contraction for a full second.</li>\r\n\r\n	<li> Slowly return to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells, barbells, smith machines and pulley machines to perform shrugging motions.</p>\n    \n',1,85,86,3,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/calf-machine-shoulder-shrug',1,'8.9',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Male/m/184_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Male/m/184_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Female/m/184_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Female/m/184_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (81,'Clean Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin with a shoulder width, double overhand or hook grip, with the bar hanging at the mid thigh position. Your back should be straight and inclined slightly forward.</li>\r\n<li> Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a clean, avoid overloading to the point that the execution slows down.</li>\r\n</ol>\n',1,87,88,4,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/clean-shrug',2,'7.5',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Male/m/673_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Male/m/673_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Female/m/673_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Female/m/673_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (82,'Kettlebell Sumo High Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>Place a kettlebell on the ground between your feet. Position your feet in a wide stance, and grasp the kettlebell with two hands. Set your hips back as far as possible, with your knees  bent. Keep your chest and head up. This will be your starting position.</li>\r\n<li> Begin by extending the hips and knees, simultaneously pulling the kettlebell to your shoulders, raising your elbows as you do so. Reverse the motion to return to the starting position.</li>\r\n</ol>\n',1,91,92,6,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-sumo-high-pull',2,'8.8',2,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Male/m/645_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Male/m/645_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Female/m/645_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Female/m/645_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (83,'Leverage Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Load the pins to an appropriate weight. Position yourself directly between the handles.</li>\r\n<li> Grasp the top handles with a comfortable grip, and then lower your hips as you take a breath. Look forward with your head and keep your chest up. </li>\r\n<li> Drive through the floor with your heels, extending your hips and knees as you rise to a standing position. Keep your arms straight throughout the movement, finishing with your shoulders back. This will be your starting position.</li>\r\n<li> Raise the weight by shrugging the shoulders towards your ears, moving straight up and down.</li>\r\n<li> Pause at the top of the motion, and then return the weight to the starting position.\r\n</li>\r\n</ol>\n',1,93,94,7,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/leverage-shrug',1,'0.0',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Male/m/898_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Male/m/898_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Female/m/898_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Female/m/898_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (84,'Smith Machine Shrug','\n        <p>\n        </p><p></p><ol><li> To begin, set the bar height on the smith machine around the middle of your thighs.  Once the correct height is chosen and the bar is loaded, grab the bar using a pronated grip (palms facing you) shoulder width apart from each other.</li>\r\n\r\n	<li> Lift the barbell up and fully extend your arms with your back straight.  This is the starting position.</li>\r\n\r\n	<li> While exhaling, elevate the bar by raising your shoulders until they come close to touching your ears.</li>\r\n\r\n	<li> Hold the contraction for a second before lowering the bar back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n\r\n<p></p><ul><li> This exercise can be performed using a squat rack with a barbell.  However, be careful not to select a weight that is so heavy that it causes you to break good form as you do not have the support of the smith machine for this variation.  Too much weight can harm your back.</li>\r\n\r\n	<li> You can also use dumbbells to perform this exercise.</li>\r\n</ul>\n',1,95,96,8,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-shrug',1,'9.3',2,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Male/m/134_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Male/m/134_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Female/m/134_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Female/m/134_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (85,'Smith Machine Upright Row','\n        <p>\n        </p><p></p><ol><li> To begin, set the bar on the smith machine to a height that is around the middle of your thighs.  Once the correct height is chosen and the bar is loaded, grasp the bar using a pronated (palms forward) grip that is shoulder width apart.  You may need some wrist wraps if using a significant amount of weight.</li>\r\n\r\n	<li> Lift the barbell up and fully extend your arms with your back straight.  There should be a slight bend at the elbows.  This is the starting position.</li>\r\n\r\n	<li> Use your side shoulders to lift the bar as you exhale.  The bar should be close to the body as you move it up.  Continue to lift it until it nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the bar, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li> Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a barbell, E-Z bar, straight bar attached to a low pulley and it can also be performed using dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Upright+Barbell+Row\">Upright Barbell Row</a> but with a Smith Machine.</p>\n    \n',1,97,98,9,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-upright-row',2,'7.8',2,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Male/m/78_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Male/m/78_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Female/m/78_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Female/m/78_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (86,'Snatch Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin with a wide grip, with the bar hanging at the mid thigh position. You can use a hook or overhand grip. Your back should be straight and inclined slightly forward.</li>\r\n<li>  Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a snatch, avoid overloading to the point that the execution slows down.</li>\r\n</ol>\n',1,99,100,10,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/snatch-shrug',2,'6.3',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Male/m/718_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Male/m/718_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Female/m/718_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Female/m/718_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (87,'Standing Dumbbell Upright Row','\n        <p>\n        </p><p></p><ol><li>  Grasp a dumbbell in each hand with a pronated (palms forward) grip that is slightly less than shoulder width.  The dumbbells should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the dumbbells as you exhale.  The dumbbells should be close to the body as you move it up and the elbows should drive the motion.  Continue to lift them until they nearly touch your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the dumbbells, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the dumbbells back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar.</p>\n    \n',1,101,102,11,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-upright-row',2,'9.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Male/m/368_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Male/m/368_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Female/m/368_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Female/m/368_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (88,'Upright Cable Row','\n        <p>\n        </p><p></p><ol><li>  Grasp a straight bar cable attachment that is attached to a low pulley with a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The bar should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the cable bar as you exhale.  The bar should be close to the body as you move it up.  Continue to lift it until it nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the bar, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a straight or e-z bar.  Another variation is to use dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\n    \n',1,103,104,12,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/upright-cable-row',2,'8.4',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Male/m/71_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Male/m/71_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Female/m/71_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Female/m/71_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (89,'Upright Row - With Bands','\n        <p>\n        </p><p></p><ol><li>  To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The handles should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the handles as you exhale.  The handles should be close to the body as you move them up.  Continue to lift the handles until they nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the handles, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the handles back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using a straight or e-z bar.  Another variation is to use dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\n    \n',1,105,106,13,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/upright-row-with-bands',2,'6.8',2,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Male/m/261_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Male/m/261_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Female/m/261_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Female/m/261_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (90,'Shoulders','',1,342,363,2,1,24,'',0,'0.0',0,0,NULL,NULL),
 (91,'Arm Circles','\n        <p>\n        </p><p></p><ol><li>Stand up and extend your arms straight out by the sides.  The arms should be parallel to the floor and perpendicular (90-degree angle) to your torso.  This will be your starting position.</li>\r\n\r\n<li>Slowly start to make circles of about 1 foot in diameter with each outstretched arm. Breathe normally as you perform the movement.</li>\r\n\r\n<li>Continue the circular motion of the outstretched arms for about ten seconds. Then reverse the movement, going the opposite direction.</li>\r\n</ol><p><strong>Tip:</strong> Ten second movements equal one set and each circle equals one repetition.</p>\r\n\r\n<p><strong>Variations:</strong> As you get stronger you can use some light resistance.</p>\n    \n',1,343,344,0,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/arm-circles',1,'5.2',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Female/m/497_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Female/m/497_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (92,'Chair Upper Body Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit on the edge of a chair, gripping the back of it.</li>\r\n<li> Straighten your arms, keeping your back straight, and  pull your upper body forward so you feel a stretch. Hold for 20-30 seconds.</li>\r\n</ol>\n',1,345,346,1,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/chair-upper-body-stretch',3,'2.4',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Male/m/485_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Male/m/485_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Female/m/485_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Female/m/485_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (93,'Elbow Circles','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit or stand with your feet slightly apart.</li>\r\n<li> Place your hands on your shoulders with your elbows at shoulder level and pointing out.</li>\r\n<li> Slowly make a circle with your elbows. Breathe out as you start the circle and breathe in as you complete the circle.</li>\r\n</ol>\n',1,347,348,2,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/elbow-circles',1,'4.7',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Male/m/498_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Male/m/498_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (94,'Round The World Shoulder Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Stand up straight with your legs together, holding a bodybar or broomstick.</li>\r\n<li> Hold the pole behind your hips with a wider than shoulder width grip. Your palms should be down and your thumbs facing out.</li>\r\n<li> Slowly lift your arms up behind your head. Don\'t force it if it gets hard to lift further.</li>\r\n</ol>\n',1,349,350,3,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/round-the-world-shoulder-stretch',3,'3.0',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Male/m/435_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Male/m/435_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Female/m/435_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Female/m/435_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (95,'Seated Front Deltoid','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit upright on the floor with your legs bent, your partner standing behind you. Stick your arms straight out to your sides, with your palms facing the ground. Attempt to move them as far behind you as possible, as your assistant holds your wrists. This will be your starting position. </li>\r\n<li>Keeping your elbows straight, attempt to move your arms to the front, with your partner gently restraining you to prevent any actual movement for 10-20 seconds.</li>\r\n<li> Now, relax your muscles and allow your partner to gently increase the stretch on the shoulders and chest. Hold for 10 to 20 seconds.</li>\r\n</ol>\n',1,351,352,4,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/seated-front-deltoid',3,'3.3',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Male/m/619_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Male/m/619_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Female/m/619_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Female/m/619_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (96,'Shoulder Circles','\n        <p>\n        </p><p>\r\n</p><ol><li>With shoulders relaxed and arms resting loosely at your sides (or in your lap if you\'re seated), gently roll your shoulders forward, up, back, and down.</li>\r\n<li> Reverse direction. You can do this exercise alternating shoulders or both at the same time.</li>\r\n</ol>\n',1,353,354,5,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-circles',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Male/m/496_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Male/m/496_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (97,'Shoulder Raise','\n        <p>\n        </p><p>\r\n</p><ol><li>Relax your arms to your sides and raise your shoulders up toward your ears, then back down.</li>\r\n</ol>\n',1,355,356,6,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-raise',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Male/m/492_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Male/m/492_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Female/m/492_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Female/m/492_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (98,'Shoulder Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Reach your left arm across your body and hold it straight.</li>\r\n With your right hand, grasp your left elbow and pull it across your body towards your chest.\r\n</ol>\n',1,357,358,7,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-stretch',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Male/m/449_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Male/m/449_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (99,'Side Wrist Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>This stretch works best standing. Cross your left arm over the midline of your body and hold the left wrist in your right hand down at the level of your hips. Start the stretch with a bent left arm.</li>\r\n<li> Slowly straighten, pull, and lift it up to shoulder height, as pictured. Feel this stretch originate in your back, not your shoulders, and don\'t pull too hard on the shoulders joint. Switch sides.</li>\r\n</ol>\n',1,359,360,8,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/side-wrist-pull',1,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Male/m/442_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Male/m/442_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Female/m/442_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Female/m/442_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (100,'Upward Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Extend both hands straight above your head, palms touching.</li>\r\n<li> Slowly push your hands up and back, keeping your back straight.</li>\r\n</ol>\n',1,361,362,9,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/upward-stretch',3,'5.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Male/m/466_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Male/m/466_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Female/m/466_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Female/m/466_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (101,'Alternating Deltoid Raise','\n        <p>\n        </p><p>\r\n</p><ol><li>In a standing positin, hold a pair of dumbbells at your side.</li>\r\n<li> Keeping your elbows slightly bent, raise the weights directly in front of you to shoulder height, avoiding any swinging or cheating.</li>\r\n<li> Return the weights to your side.</li>\r\n<li> On the next repetition, raise the weights laterally, raising them out to your side to about shoulder height.</li>\r\n<li> Return the weights to the starting position and continue alternating to the front and side.\r\n</li>\r\n</ol>\n',0,109,110,30,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-deltoid-raise',1,'8.9',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (102,'Alternating Hang Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean one kettlebell to your shoulder and hold on to the other kettlebell in a hanging position. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. \r\nRotate your wrist as you do so.</li> <li>Lower the cleaned kettlebell to a hanging position and clean the alternate kettlebell. Repeat. </li>\r\n</ol>\n',0,111,112,40,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-hang-clean',2,'3.7',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (103,'Alternating Kettlebell Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so.</li>\r\n<li> Press one directly overhead by extending through the elbow, turning it so the palm faces forward while holding the other kettlebell stationary .</li>\r\n<li> Lower the pressed kettlebell to the starting position and immediately press with  your other arm.</li>\r\n</ol>\n',0,113,114,50,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-kettlebell-press',2,'7.8',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (104,'Arnold Dumbbell Press','\n        <p>\n        </p><p></p><ol><li>Sit on an exercise bench with back support and hold two dumbbells in front of you at about upper chest level with your palms facing your body and your elbows bent. <strong>Tip:</strong> Your arms should be next to your torso.  The starting position should look like the contracted portion of a dumbbell curl.</li>\r\n\r\n<li>Now to perform the movement, raise the dumbbells as you rotate the palms of your hands  until they are facing forward.</li>\r\n\r\n<li>Continue lifting the dumbbells until your arms are extended above you in straight arm position.  Breathe out as you perform this portion of the movement.</li>\r\n\r\n<li>After a second pause at the top, begin to lower the dumbbells to the original position by rotating the palms of your hands towards you.  <strong>Tip:</strong> The left arm will be rotated in a counter clockwise manner while the right one will be rotated clockwise.  Breathe in as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform the exercise standing up but that is not recommended for people with lower back issues.</p>\n    \n',0,115,116,60,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/arnold-dumbbell-press',2,'8.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Male/m/82_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Male/m/82_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Female/m/82_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Female/m/82_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (105,'Back Flyes - With Bands','\n        <p>\n        </p><p></p><ol><li>Run a band around a stationary post like that of a squat rack.</li>\r\n\r\n<li>Grab the band by the handles and stand back so that the tension in the band rises.</li>\r\n\r\n<li>Extend and lift the arms straight in front of you. Tip: Your arms should be straight and parallel to the floor while perpendicular to your torso.  Your feet should be firmly planted on the floor spread at shoulder width.  This will be your starting position.</li>\r\n\r\n<li>As you exhale, move your arms to the sides and back.  Keep your arms extended and parallel to the floor. Continue the movement until the arms are extended to your sides.</li>\r\n\r\n<li>After a pause, go back to the original position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong>  You can perform this exercise on a rear delt machine as well or using a pulley machine.</p>\n    \n',0,117,118,70,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/back-flyes-with-bands',2,'8.5',2,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Male/m/253_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Male/m/253_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Female/m/253_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Female/m/253_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (106,'Barbell Rear Delt Row','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a barbell using a wide (higher than shoulder width) and overhand (palms facing your body) grip.</li>\r\n\r\n<li>Bend knees slightly and bend over as you keep the natural arch of your back. Let the arms hang in front of you as they hold the bar. Once your torso is parallel to the floor, flare the elbows out and away from your body.  Tip: Your torso and your arms should resemble the letter \"T\".  Now you are ready to begin the exercise.</li>\r\n\r\n<li>While keeping the upper arms perpendicular to the torso, pull the barbell up towards your upper chest as you squeeze the rear delts and you breathe out.  Tip: When performed correctly, this exercise should resemble a bench press in reverse.  Also, refrain from using your biceps to do the work.  Focus on targeting the rear delts; the arms should only act as hooks.</li>\r\n\r\n<li>Slowly go back to the initial position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise using a smith machine or a T-bar row. You can also use the low pulley as long as you use a wide grip bar attachment.</p>\r\n\n    \n',0,119,120,80,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-rear-delt-row',2,'8.9',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Male/m/307_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Male/m/307_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Female/m/307_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Female/m/307_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (107,'Barbell Shoulder Press','\n        <p>\n        </p><p></p><ol><li> Sit on a bench with back support in a squat rack. Position a barbell at a height that is just above your head.   Grab the barbell with a pronated grip (palms facing forward).</li>\r\n\r\n	<li>  Once you pick up the barbell with the correct grip width, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the shoulders slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> This exercise can also be performed standing.</li>\r\n</ul>\n',0,121,122,90,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-shoulder-press',2,'8.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Male/m/308_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Male/m/308_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Female/m/308_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Female/m/308_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (108,'Bent Over Dumbbell Rear Delt Raise With Head On Bench','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a dumbbell in each hand and with an incline bench in front of you.</li>\r\n\r\n<li>While keeping your back straight and maintaining the natural arch of your back, lean forward until your forehead touches the bench in front of you.  Let the arms hang in front of you perpendicular to the ground. The palms of your hands should be facing each other and your torso should be parallel to the floor. This will be your starting position.</li>\r\n\r\n<li>Keeping your torso forward and stationary, and the arms straight with a slight bend at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor.  Exhale as you lift the weights.  Caution: avoid swinging the torso or bringing the arms back as opposed to the side.</li>\r\n\r\n<li>After a one second contraction at the top, slowly lower the dumbbells back to the starting position.</li>\r\n\r\n<li>Repeat the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed with cables or seating.</p>\r\n\n    \n',0,125,126,100,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bent-over-dumbbell-rear-delt-raise-with-head-on-bench',1,'8.6',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Male/m/83_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Male/m/83_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Female/m/83_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Female/m/83_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (109,'Bent Over Low-Pulley Side Lateral','\n        <p>\n        </p><p></p><ol><li>Select a weight and hold the handle of the low pulley with your right hand.</li>\r\n\r\n<li>Bend at the waist until your torso is nearly parallel to the floor. Your legs should be slightly bent with your left hand placed on your lower left thigh.  Your right arm should be hanging from your shoulder in front of you and with a slight bend at the elbow. This will be your starting position.</li>\r\n\r\n<li>Raise your right arm, elbow slightly bent, to the side until the arm is parallel to the floor and in line with your right ear. Breathe out as you perform this step.</li>\r\n\r\n<li>Slowly lower the weight back to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and repeat the movement with the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with dumbbells or exercise bands.</p>\r\n\n    \n',0,127,128,110,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bent-over-low-pulley-side-lateral',1,'8.9',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Male/m/73_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Male/m/73_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Female/m/73_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Female/m/73_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (110,'Bradford/Rocky Presses','\n        <p>\n        </p><p></p><ol><li>Sit on a Military Press Bench with a bar at shoulder level with a pronated grip (palms facing forward).  <strong>Tip:</strong> Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down. This is your starting position.</li>\r\n\r\n<li>Once you pick up the barbell with the correct grip, lift the bar up over your head by locking your arms.  </li>\r\n\r\n<li>Now lower the bar down to the back of the head slowly as you inhale.</li>\r\n\r\n<li>Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n<li>Lower the bar down to the starting position slowly as you inhale. This is one repetition.</li>\r\n\r\n<li>Alternate in this manner until you complete the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> For more stress on the shoulders, only lift the bar until it is slightly above the head and then lower to the opposite side.  In this manner you keep more constant tension on the shoulders while minimizing triceps involvement.</p>\r\n\n    \n',0,129,130,120,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bradfordrocky-presses',2,'8.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (111,'Cable Internal Rotation','\n        <p>\n        </p><p></p><ol><li>Sit next to a low pulley sideways (with legs stretched in front of you or crossed) and grasp the single hand cable attachment with the arm nearest to the cable.  <strong>Tip:</strong> If you can adjust the pulley&acirc;&#128;&#153;s height, you can use a flat bench to sit on instead.</li>\r\n\r\n<li>Position the elbow against your side with the elbow bent at 90&Acirc;&deg; and the arm pointing towards the pulley.  This will be your starting position.</li>\r\n\r\n<li>Pull the single hand cable attachment toward your body by internally rotating your shoulder until your forearm is across your abs.  You will be creating an imaginary semi-circle.  <strong>Tip:</strong> The forearm should be perpendicular to your torso at all times.</li>\r\n\r\n<li>Slowly go back to the initial position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then repeat the movement with the next arm.</li>\r\n</ol><p><strong>Caution:</strong> Do not use heavy weights for this exercise as if you use too much you risk rotator cuff injury.</p>\r\n\r\n<p><strong>Variations:</strong> You can use dumbbells for this movement as well as exercise bands.</p>\r\n\n    \n',0,131,132,130,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-internal-rotation',2,'8.6',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Male/m/315_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Male/m/315_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Female/m/315_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Female/m/315_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (112,'Cable Rope Rear-Delt Rows','\n        <p>\n        </p><p></p><ol><li> Sit in the same position on a low pulley row station as you would if you were doing seated cable rows for the back.</li>\r\n\r\n	<li> Attach a rope to the pulley and grasp it with an overhand grip.  Your arms should be extended and parallel to the floor with the elbows flared out.</li>\r\n\r\n	<li> Keep your lower back upright and slide your hips back so that your knees are slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Pull the cable attachment towards your upper chest, just below the neck, as you keep your elbows up and out to the sides.  Continue this motion as you exhale until the elbows travel slightly behind the back. <strong>Tip:</strong> Keep your upper arms horizontal, perpendicular to the torso and parallel to the floor throughout the motion.</li>\r\n\r\n	<li> Go back to the initial position where the arms are extended and the shoulders are stretched forward. Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also perform this exercise using exercise bands or dumbbells.  You can also perform this movement standing in front of a high pulley.</p>\n    \n',0,133,134,140,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-rope-rear-delt-rows',2,'8.9',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Male/m/299_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Male/m/299_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Female/m/299_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Female/m/299_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (113,'Cable Seated Lateral Raise','\n        <p>\n        </p><p></p><ol><li> Stand in the middle of two low pulleys that are opposite to each other and place a flat bench right behind you (in perpendicular fashion to you; the narrow edge of the bench should be the one behind you).  Select the weight to be used on each pulley.</li>\r\n\r\n	<li> Now sit at the edge of the flat bench behind you with your feet placed in front of your knees.</li>\r\n\r\n	<li> Bend forward while keeping your back flat and rest your torso on the thighs.</li>\r\n\r\n	<li> Have someone give you the single handles attached to the pulleys.  Grasp the left pulley with the right hand and the right pulley with the left after you select your weight. The pulleys should run under your knees and your arms will be extended with palms facing each other and a slight bend at the elbows.  This will be the starting position.</li>\r\n\r\n	<li> While keeping the arms stationary, raise the upper arms to the sides until they are parallel to the floor and at shoulder height.  Exhale during the execution of this movement and hold the contraction for a second.</li>\r\n\r\n	<li> Slowly lower your arms to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions. <strong>Tip:</strong> Maintain upper arms perpendicular to torso and a fixed elbow position (10 degree to 30 degree angle) throughout exercise.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with exercise bands or dumbbells.</p>\n    \n',0,135,136,150,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-seated-lateral-raise',1,'8.7',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Male/m/79_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Male/m/79_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Female/m/79_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Female/m/79_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (114,'Cable Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Move the cables to the bottom of the towers and select an appropriate weight.</li>\r\n<li> Stand directly in between the uprights. Grasp the cables and hold them at shoulder height, palms facing forward. This will be your starting position.</li>\r\n<li> Keeping your head and chest up, extend through the elbow to press the handles directly over head.</li>\r\n<li> After pausing at the top, return to the starting position and repeat.\r\n</li>\r\n</ol>\n',0,137,138,160,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-shoulder-press',2,'0.0',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Male/m/848_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Male/m/848_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Female/m/848_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Female/m/848_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (115,'Circus Bell','\n        <p>\n        </p><p>\r\n</p><ol><li>The circus bell is an oversized dumbbell with a thick handle. Begin with the dumbbell between your feet, and grip the handle with both hands.</li>\r\n<li> Clean the dumbbell by extending through your hips and knees to deliver the implement to the desired shoulder, letting go with the extra hand.</li>\r\n<li> Ensure that you get one of the dumbbell heads behind the shoulder to keep from being thrown off balance. To raise it overhead, dip by flexing the knees, and the drive upwards as you extend the dumbbell overhead, leaning slightly away from it as you do so.</li>\r\n<li> Carefully guide the bell back to the floor, keeping it under control as much as possible. It is best to perform this event on a thick rubber mat to prevent damage to the floor. </li>\r\n</ol>\n',0,139,140,170,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/circus-bell',2,'9.1',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (116,'Clean and Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>With a barbell on the floor close to the shins, take an overhand or hook grip just outside the legs. Lower your hips with the weight focused on the heels, back  straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position. </li>\r\n<li> Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight. Move the weight with control as you continue to above the knees.</li>\r\n<li> Next comes the second pull, the main source of acceleration for the clean. As the bar approaches the mid-thigh position, begin extending through the hips. In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward. There should be no need to actively pull through the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, leaning slightly back, with the arms still extended.</li>\r\n<li> As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out. At peak extension, aggressively pull yourself down, rotating your elbows under the bar as you do so. Receive the bar in a front squat position, the depth of which is dependent upon the height of the bar at the end of the third pull. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom squat position, which will help in the recovery.  </li>\r\n<li>Immediately recover by driving through the heels, keeping the torso upright and elbows up. Continue until you have risen to a standing position. </li>\r\n<li> The second phase is the jerk, which raises the weight overhead. Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible.</li>\r\n<li> Drive through the heels create as much speed and force as possible, and be sure to move your head out of the way as the bar leaves the shoulders.</li>\r\n<li> At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible. In the brief moment the feet are not actively driving against the platform, the athletes effort to push the bar up will drive them down. The feet should be split, with one foot forward, and one foot back. Receive the bar with the arms locked out overhead. Return to a standing position. </li>\r\n</ol>\n',0,141,142,180,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/clean-and-jerk',2,'9.5',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (117,'Crucifix','\n        <p>\n        </p><p>\r\n</p><ol><li>In the crucifix, you statically hold weights out to the side for time. While the event can be practiced using dumbbells, it is best to practice with one of the various implements used, such as axes and hammers, as it feels different.</li>\r\n<li> Begin standing, and raise your arms out to the side holding the implements. Your arms should be parallel to the ground. In competition, judges or sensors are used to let you know when you break parallel. Hold for as long as you can. Typically, the weights should be heavy enough that you fail in 30-60 seconds.</li>\r\n</ol>\n',0,143,144,190,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/crucifix',1,'0.0',3,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Male/m/675_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Male/m/675_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Female/m/675_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Female/m/675_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (118,'Cuban Press','\n        <p>\n        </p><p></p><ol><li> From a seated or standing position, hold a dumbbell in each hand with your shoulders rotated forward. Your arms should be fully extended next to your thighs with only a slight bend at the elbows and with the palms of your hands facing your thighs.  This will be your starting position.</li>\r\n\r\n	<li> Begin the movement by lifting the elbows up, as if performing a dumbbell upright row, until they are at shoulder height.  <strong>Tip:</strong> The torso and the upper arm should resemble the letter \"T\". Exhale as you perform this movement.</li>\r\n\r\n	<li> Once you reach this position, inhale and then externally rotate the dumbbells up while keeping the upper arms in the same level and exhaling.  Continue this movement until the forearms are perpendicular to the floor and the hands are pointing towards the ceiling. Inhale once you complete this movement.</li>\r\n\r\n	<li> Now press the dumbbells up over your head as if performing a shoulder press as you exhale.</li>\r\n\r\n	<li> Go back to the initial position as you breathe in by reversing the steps.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can also use a barbell.</p>\n    \n',0,145,146,200,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cuban-press',2,'6.9',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (119,'Double Kettlebell Alternating Hang Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean one kettlebell to your shoulder and hold on to the other kettlebell.</li>\r\n<li> With a fluid motion, lower the top kettlebell while driving the bottom kettlebell up. </li>\r\n</ol>\n',0,147,148,210,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-alternating-hang-clean',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (120,'Double Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle in each hand.</li>\r\n<li> Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. This will be your starting position.</li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum.</li>\r\n<li> As you do so, press the kettlebells overhead to lockout by extending the arms, using your body\'s momentum to move the weights.</li>\r\n<li> Return your feet to the ground in a split fashion, with one foot forward and one foot back.</li>\r\n<li> Keeping the weights overhead, return to a standing position, bringing your feet together. Lower the weights to perform the next repetition.</li>\r\n</ol>\n',0,149,150,220,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-jerk',2,'6.5',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Female/m/557_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Female/m/557_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (121,'Double Kettlebell Push Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. </li>\r\n<li>Squat down a few inches and reverse the motion rapidly. Use the momentum from the legs to drive the\r\nkettlebells overhead.</li>\r\n<li> Once the kettlebells are locked out, lower the kettlebells to your shoulders and repeat.</li>\r\n</ol>\n',0,151,152,230,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-push-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (122,'Double Kettlebell Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells behind your feet. Bend your knees and sit back to pick up the kettlebells.</li>\r\n<li> Swing the kettlebells between your legs forcefully and reverse the direction.</li>\r\n<li> Drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion. </li>\r\n</ol>\n',0,153,154,240,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-snatch',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (123,'Dumbbell Incline Shoulder Raise','\n        <p>\n        </p><p></p><ol><li>Sit on an Incline Bench while holding a dumbbell on each hand on top of your thighs.</li>\r\n\r\n<li>Lift your legs up to kick the weights to your shoulders and lean back. Position the dumbbells above your shoulders with your arms extended.  The arms should be perpendicular to the floor with your palms facing forward and knuckles pointing towards the ceiling.  This will be your starting position.</li>\r\n\r\n<li>While keeping the arms straight and locked, lift the dumbbells by raising the shoulders from the bench as you breathe out.</li>\r\n\r\n<li>Bring back the dumbbells to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can use a barbell or a smith machine in order to perform this exercise.\r\n</p>\n    \n',0,155,156,250,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-incline-shoulder-raise',1,'7.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Male/m/318_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Male/m/318_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Female/m/318_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Female/m/318_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (124,'Dumbbell Lying One-Arm Rear Lateral Raise','\n        <p>\n        </p><p></p><ol><li>While holding a dumbbell in one hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench.  The other hand can be used to hold to the leg of the bench for stability.</li>\r\n\r\n<li>Position the palm of the hand that is holding the dumbbell in a neutral manner (palms facing your torso) as you keep the arm extended with the elbow slightly bent.  This will be your starting position.</li>\r\n\r\n<li>Now raise the arm with the dumbbell to the side until your elbow is at shoulder height and your arm is roughly parallel to the floor as you exhale. Tip: Maintain your arm perpendicular to the torso while keeping your arm extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n<li>Slowly lower the dumbbell to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can perform this exercise with both arms at the same time and also keeping the palms of the hands facing back as opposed to facing your torso.\r\n</p>\n    \n',0,161,162,260,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-lying-one-arm-rear-lateral-raise',1,'9.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Male/m/319_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Male/m/319_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Female/m/319_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Female/m/319_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (125,'Dumbbell Lying Rear Lateral Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in each hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench.</li>\r\n\r\n	<li> Position the palms of the hands in a neutral manner (palms facing your torso) as you keep the arms extended with the elbows slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arms to the side until your elbows are at shoulder height and your arms are roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arms perpendicular to the torso while keeping them extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbells to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with just one arm and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,163,164,270,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-lying-rear-lateral-raise',1,'8.5',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Male/m/322_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Male/m/322_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Female/m/322_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Female/m/322_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (126,'Dumbbell One-Arm Shoulder Press','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell and either sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs or stand up straight.</li>\r\n\r\n<li>Clean the dumbbell up to bring it to shoulder height.  The other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface.</li>\r\n\r\n<li>Rotate the wrist so that the palm of your hand is facing forward.  This is your starting position.</li>\r\n\r\n<li>As you exhale, push the dumbbell up until your arm is fully extended.</li>\r\n\r\n<li>After a second pause, slowly come down back to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then switch arms.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can perform the exercise standing or sitting on a regular flat bench.  For people with lower back problems, the version described is the recommended one.\r\n</p>\r\n<p>\r\nYou can also perform the exercise as Arnold Schwarzenegger used to do it, which is to start holding the dumbbells with a supinated grip (palms facing you) in front of your shoulders and then, as you start pushing up, you align the dumbbells in the starting position described on step 3 by rotating your wrists and touch the dumbbells at the top.  As you come down, then you would go back to the starting position by rotating the wrist throughout the lowering portion until the palms of your hands are facing you.  This variation is called the Arnold Press.  However, it is not recommended if you have rotator cuff problems.\r\n</p>\n    \n',0,165,166,280,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-one-arm-shoulder-press',2,'8.5',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Male/m/337_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Male/m/337_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Female/m/337_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Female/m/337_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (127,'Dumbbell One-Arm Upright Row','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell and stand up straight with your arm extended in front of you with a slight bend at the elbows and your back straight.  This will be your starting position. <strong>Tip:</strong> The dumbbell should be resting on top of your thigh with the palm of your hands facing your thighs.</li>\r\n\r\n<li>Keep the other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface. This will be your starting position.</li>\r\n\r\n<li>Use your side shoulders to lift the dumbbell as you exhale.  The dumbbell should be close to the body as you move it up.  Continue to lift it until the dumbbell is nearly in line with your chin.  Tip: Your elbows should drive the motion.  As you lift the dumbbell, your elbow should always be higher than your forearm.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n<li>Lower the dumbbell back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and switch arms.</li>\r\n</ol><p>\r\n<strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.\r\n</p>\r\n<p>\r\n<strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar, cables and exercise band.\r\n</p>\n    \n',0,167,168,290,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-one-arm-upright-row',2,'7.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Male/m/325_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Male/m/325_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Female/m/325_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Female/m/325_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (128,'Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell in each arm and stand up straight with your arms extended by your sides with a slight bend at the elbows and your back straight.  This will be your starting position. <strong>Tip:</strong> The dumbbell should be next to your thighs with the palm of your hands facing back.</li>\r\n\r\n<li>Use your side shoulders to lift the dumbbells as you exhale.  The dumbbells should be to the side of the body as you move them up.  Continue to lift it until the dumbbells are nearly in line with your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the dumbbell, your elbow should always be higher than your forearm.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n<li>Lower the dumbbells back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from this movement and substitute by some form of lateral raises.\r\n</p>\r\n<p>\r\n<strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar, cables and exercise band.\r\n</p>\n    \n',0,169,170,300,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-raise',2,'8.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Male/m/327_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Male/m/327_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Female/m/327_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Female/m/327_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (130,'External Rotation','\n        <p>\n        </p><p></p><ol><li>Lie sideways on a flat bench with one arm holding a dumbbell and the other hand on top of the bench folded so that you can rest your head on it.</li>\r\n\r\n<li>Bend the elbows of the arm holding the dumbbell so that it creates a 90-degree angle between the upper arm and the forearm.  <strong>Tip:</strong> Keep the arm parallel to your torso.</li>\r\n\r\n<li>Now bend the elbow while keeping the upper arm stationary.  In this manner, the forearm will be parallel to the floor and perpendicular to your torso (Tip: So the forearm will be directly in front of you).  The upper arm will be stationary by your torso and should be parallel to the floor (aligned with your torso at all times).  This will be your starting position.</li>\r\n\r\n<li>As you breathe out, externally rotate your forearm so that the dumbbell is lifted up in a semicircle motion as you maintain the 90 degree angle bend between the upper arms and the forearm.  You will continue this external rotation until the forearm is perpendicular to the floor and the torso pointing towards the ceiling.  At this point you will hold the contraction for a second.</li>\r\n\r\n<li>As you breathe in, slowly go back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Caution:</strong> There is no need to go heavy with this exercise.  Too much weight will cause rotator cuff injury.</p>\r\n\r\n<p><strong>Variations:</strong> You can perform this exercise standing and with cables.</p>\n    \n',0,175,176,320,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation',1,'8.9',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Male/m/232_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Male/m/232_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Female/m/232_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Female/m/232_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (131,'External Rotation with Band','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nChoke the band around a post. The band should be at the same height as your elbow. Stand with your left side to the band a couple of feet away.</li>\r\n<li> Grasp the end of the band with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position.</li>\r\n<li> With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching across the front of your torso. This will be your starting position.</li>\r\n<li> Execute the movement by rotating your arm in a backhand motion, keeping your elbow in place.</li>\r\n<li> Continue as far as you are able, pause, and then return to the starting position. \r\n</li>\r\n</ol>\n',0,177,178,330,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation-with-band',2,'0.0',4,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Male/m/868_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Male/m/868_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Female/m/868_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Female/m/868_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (132,'External Rotation with Cable','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the cable to the same height as your elbow. Stand with your left side to the band a couple of feet away.</li>\r\n<li> Grasp the handle with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position. </li>\r\n<li>With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching across the front of your torso. This will be your starting position.</li>\r\n<li> Execute the movement by rotating your arm in a backhand motion, keeping your elbow in place. </li>\r\nContinue as far as you are able, pause, and then return to the starting position. \r\n\r\n</ol>\n',0,179,180,340,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation-with-cable',1,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Male/m/869_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Male/m/869_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Female/m/869_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Female/m/869_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (133,'Face Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>Facing a high pulley with a rope or dual handles attached, pull the weight directly towards your face, separating your hands as you do so. Keep your upper arms parallel to the ground.</li>\r\n</ol>\n',0,181,182,350,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/face-pull',2,'8.8',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Male/m/681_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Male/m/681_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Female/m/681_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Female/m/681_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (134,'Front Cable Raise','\n        <p>\n        </p><p></p><ol><li>Select the weight on a low pulley machine and grasp the single hand cable attachment that is attached to the low pulley with your left hand.</li>\r\n\r\n<li>Face away from the pulley and put your arm straight down with the hand cable attachment in front of your thighs at arms\' length with the palms of the hand facing your thighs.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the left arm to the front with a slight bend on the elbow and the palms of the hand always faces down.  Continue to go up until you arm is slightly above parallel to the floor.  Exhale as you execute this portion of the movement and pause for a second at the top.</li>\r\n \r\n<li>Now as you inhale lower the arm back down slowly to the starting position.</li>\r\n \r\n<li>Once all of the recommended amount of repetitions have been performed for this arm, switch arms and perform the exercise with the right one.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can be performed also with dumbbells or an exercise band.</p>\r\n\n    \n',0,183,184,360,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-cable-raise',1,'8.6',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Male/m/75_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Male/m/75_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Female/m/75_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Female/m/75_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (136,'Front Incline Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Sit down on an incline bench with the incline set anywhere between 30 to 60 degrees while holding a dumbbell on each hand. Tip: You can change the angle to hit the muscle a little differently each time.</li>\r\n\r\n<li>Extend your arms straight in front of you and have your palms facing down with the dumbbells raised about 1 inch above your thighs.  This will be your starting position.</li>\r\n\r\n<li>Slowly raise the dumbbells straight up until they are slightly above your shoulders, while keeping your elbows locked. Squeeze at the top for a second and make sure you breathe out during this portion of the movement.  <strong>Tip:</strong> Keep your head resting down against the bench and your legs on the floor at all times.</li>\r\n\r\n<li>Lower the arms back to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use a barbell as well for this exercise.</p>\n    \n',0,187,188,380,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-incline-dumbbell-raise',1,'9.1',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Male/m/231_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Male/m/231_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Female/m/231_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Female/m/231_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (137,'Front Plate Raise','\n        <p>\n        </p><p></p><ol><li>While standing straight, hold a barbell plate in both hands at the 3 and 9 o\'clock positions. Your palms should be facing each other and your arms should be extended and locked with a slight bend at the elbows and the plate should be down near your waist in front of you as far as you can go.  <strong>Tip:</strong> The arms will remain in this position throughout the exercise.  This will be your starting position.</li>\r\n\r\n<li>Slowly raise the plate as you exhale until it is a little above shoulder level. Hold the contraction for a second. <strong>Tip:</strong> make sure that you do not swing the weight or bend at the elbows.  Your torso should remain stationary throughout the movement as well.</li>\r\n\r\n<li>As you inhale, slowly lower the plate back down to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells, barbells, cables or exercise bands to perform this movement.</p>\r\n\n    \n',0,189,190,390,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-plate-raise',1,'8.3',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Male/m/230_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Male/m/230_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Female/m/230_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Female/m/230_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (138,'Front Two-Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Pick a couple of dumbbells and stand with a straight torso and the dumbbells on front of your thighs at arms length with the palms of the hand facing your thighs.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the dumbbells to the front with a slight bend on the elbow and the palms of the hands always facing down.  Continue to go up until you arms are slightly above parallel to the floor.  Exhale as you execute this portion of the movement and pause for a second at the top.</li>\r\n\r\n<li>As you inhale, lower the dumbbells back down slowly to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed by alternating hands, meaning doing one repetition with the right arm, and then one with the left, back to the right, etc.  Also, you could use a barbell as well.</p>\r\n\n    \n',0,191,192,400,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-two-dumbbell-raise',1,'9.1',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Male/m/372_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Male/m/372_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Female/m/372_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Female/m/372_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (139,'Handstand Push-Ups','\n        <p>\n        </p><p></p><ol><li> With your back to the wall bend at the waist and place both hands on the floor at shoulder width.</li>\r\n\r\n	<li> Kick yourself up against the wall with your arms straight. Your body should be upside down with the arms and legs fully extended.  Keep your whole body as straight as possible.  <strong>Tip:</strong> If doing this for the first time, have a spotter help you.  Also, make sure that you keep facing the wall with your head, rather than looking down.</li>\r\n\r\n	<li> Slowly lower yourself to the ground as you inhale until your head almost touches the floor.  <strong>Tip:</strong> It is of utmost importance that you come down slow in order to avoid head injury.</li>\r\n\r\n	<li> Push yourself back up slowly as you exhale until your elbows are nearly locked.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Ensure that the floor surface is not slippery and also, if performing for the first time, use a spotter until you get good at this exercise.</p>\n    \n',0,193,194,410,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/handstand-push-ups',2,'7.9',1,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Male/m/227_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Male/m/227_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Female/m/227_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Female/m/227_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (140,'Iron Cross','\n        <p>\n        </p><p></p><ul><p>1. Stand with feet shoulder width apart holding a dumbbell in each hand.\r\n\r\n	</p><p>2. Now lift the arms to your sides so that your torso and the arms form the letter \"T\".  The arms should be parallel to the floor and perpendicular to each side of your torso.  The palms should be facing forward.  This will be your starting position.</p>\r\n\r\n	<p>3-a.  As you inhale slowly squat down by bending at the knees and holding the back erect as if you were going to sit on a chair.  Continue with the squat motion until your thighs are parallel to the floor.  <strong>Tip:</strong> Remember that the knees should never go past your toes.</p>\r\n\r\n	<p>3-b.  As you squat down, simultaneously bring the arms in front of you until the palms of the hands are facing each other.  <strong>Tip:</strong> This will look like a flat bench flye but performed standing up.  The arms will remain extended throughout the movement and only the shoulder joint will move.</p>\r\n\r\n	<p>4. Now start pressing with the ball of the foot mainly in order to go back to the initial position and simultaneously move the arms out away from your sides in order to form a giant \"T\" as you stand upright.  Exhale as you perform this movement.</p>\r\n\r\n	<p>5. Repeat for the recommended amount of repetitions.</p>\r\n</ul>\n',0,195,196,420,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/iron-cross',2,'8.1',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Male/m/195_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Male/m/195_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Female/m/195_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Female/m/195_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (141,'Jerk Balance','\n        <p>\n        </p><p>\r\n</p><ol><li>This drill helps you learn to drive yourself low enough during the jerk and corrects those who move backward during the movement. Begin with the bar racked in the jerk position, with the shoulders forward, torso upright, and the feet split slightly apart.</li>\r\n<li> Initiate the movement as you would a normal jerk, dipping at the knees while keeping your torso vertical, and driving back up forcefully, using momentum and not your arms to elevate the weight.</li>\r\n<li> Keep the rear foot in place, using it to drive your body forward into a full split as you jerk the weight. Recover by standing up with the weight overhead.</li>\r\n</ol>\n',0,197,198,430,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/jerk-balance',2,'0.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (142,'Kettlebell Arnold Press','\n        <p>\n        </p><p>\r\n</p><ol><li> Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you raise the kettlebell towards your shoulder. The palm should be facing inward.</li>\r\n<li> Looking straight ahead, press the kettlebell out and overhead, rotating your wrist so that your palm faces forward at the top of the motion.</li>\r\n<li>Return the kettlebell to the starting position, with the palm facing in.</li>\r\n</ol>\n',0,199,200,440,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-arnold-press-',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Male/m/512_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Male/m/512_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Female/m/512_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Female/m/512_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (143,'Kettlebell Seated Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit on the floor and spread your legs out comfortably.</li>\r\n<li> Clean one kettlebell to your shoulder.</li>\r\n<li> Press the kettlebell up and out until it is locked out overhead. Return to the starting position.</li>\r\n</ol>\n',0,201,202,450,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-seated-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Male/m/555_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Male/m/555_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Female/m/555_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Female/m/555_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (144,'Kettlebell Seesaw Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells two your shoulders. </li>\r\n<li>Press one kettlebell.</li>\r\n<li> Lower the kettlebell and immediately press the other kettlebell. Make sure to do the same amount of reps on both sides.</li>\r\n</ol>\n',0,203,204,460,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-seesaw-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Female/m/558_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Female/m/558_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (145,'Kettlebell Thruster','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so. This will be your starting position.</li>\r\n<li> Begin to squat by flexing your hips and knees, lowering your hips between your legs. Maintain an upright, straight back as you descend as low as you can.</li>\r\n<li> At the bottom, reverse direction and squat by extending your knees and hips, driving through your heels. As you do so, press both kettlebells overhead by extending your arms straight up, using the momentum from the squat to help drive the weights upward.</li>\r\n<li> As you begin the next repetition, return the weights to the shoulders.</li>\r\n</ol>\n',0,205,206,470,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-thruster',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (146,'Kettlebell Turkish Get-Up (Lunge style)','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on your back on the  floor and press a kettlebell to the top position by extending the elbow. Bend the knee on the same side as the kettlebell.</li>\r\n<li> Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position. Using your free hand, push yourself to a seated position, then progressing to one knee.</li>\r\n<li> While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat. </li>\r\n</ol>\n',0,207,208,480,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-turkish-get-up-lunge-style',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (147,'Kettlebell Turkish Get-Up (Squat style)','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on your back on the  floor and press a kettlebell to the top position by extending the elbow. Bend the knee on the same side as the kettlebell.</li>\r\n<li> Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position.</li>\r\n<li> Using your free hand, push yourself to a seated position, then progressing to your feet. While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat. </li>\r\n</ol>\n',0,209,210,490,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-turkish-get-up-squat-style',2,'9.7',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (148,'Lateral Raise - With Bands','\n        <p>\n        </p><p></p><ol><li> To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The handles should be resting on the sides of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>  Use your side shoulders to lift the handles to the sides as you exhale.  Continue to lift the handles until they are slightly above parallel.  <strong>Tip:</strong> As you lift the handles, slightly tilt the hand as if you were pouring water and keep your arms extended.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li> Lower the handles back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using dumbbells or a pulley machine.</p>\n    \n',0,211,212,500,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lateral-raise-with-bands',1,'8.0',1,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Male/m/258_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Male/m/258_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Female/m/258_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Female/m/258_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (149,'Leverage Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the top  of the shoulders at the beginning of the motion. Your chest and head should be up and handles held with a pronated grip. This will be your starting position. </li>\r\n<li> Press the handles upward by extending through the elbow. </li>\r\n<li>After a brief pause at the top, return the weight to just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.\r\n</li>\r\n</ol>\n',0,213,214,510,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/leverage-shoulder-press',2,'9.8',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Male/m/897_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Male/m/897_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Female/m/897_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Female/m/897_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (150,'Log Lift','\n        <p>\n         </p><p>\r\n</p><ol><li>Begin standing with the log in front of you. Grasp the handles, and begin to clean the log. As you are bent over to start the clean, attempt to get the log as high as possible, pulling it into your chest. Extend through the hips and knees to bring it up to complete the clean. </li>\r\n<li> Push your head back and look up, creating a shelf on your chest to rest the log. Begin the press by dipping, flexing slightly through the knees and reversing the motion. This push press will generate momentum to start the log moving vertically. Continue by extending through the elbows to press the log above your head. There are no strict rules on form, so use whatever techniques you are most efficient with. As the log is pressed, ensure that you push your head through on each repetition, looking forward.</li>\r\n<li> Repeat as many times as possible. Attempt to control the descent of the log as it is returned to the ground.  </li>\r\n</ol>\n',0,215,216,520,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/log-lift',2,'0.0',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (151,'Low Pulley Row To Neck','\n        <p>\n        </p><p></p><ol><li> Sit on a low pulley row machine with a rope attachment.</li>\r\n\r\n	<li> Grab the ends of the rope using a palms-down grip and sit with your back straight and your knees slightly bent.  <strong>Tip:</strong> Keep your back almost completely vertical and your arms fully extended in front of you.  This will be your starting position.</li>\r\n\r\n	<li> While keeping your torso stationary, lift your elbows and start bending them as you pull the rope towards your neck while exhaling.  Throughout the movement your upper arms should remain parallel to the floor.  <strong>Tip:</strong> Continue this motion until your hands are almost next to your ears (the forearms will not be parallel to the floor at the end of the movement as they will be angled a bit upwards) and your elbows are out away from your sides.</li>\r\n\r\n	<li> After holding for a second or so at the contracted position, come back slowly to the starting position as you inhale.  <strong>Tip:</strong> Again, during no part of the movement should the torso move.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can use a straight bar attachment as well or a bench and exercise bands.</p>\n    \n',0,217,218,530,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/low-pulley-row-to-neck',2,'8.8',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Male/m/156_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Male/m/156_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Female/m/156_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Female/m/156_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (152,'Lying One-Arm Lateral Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in one hand, lay with your chest down on a flat bench.  The other hand can be used to hold to the leg of the bench for stability.</li>\r\n\r\n	<li> Position the palm of the hand that is holding the dumbbell in a neutral manner (palms facing your torso) as you keep the arm extended with the elbow slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arm with the dumbbell to the side until your elbow is at shoulder height and your arm is roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arm perpendicular to the torso while keeping your arm extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbell to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with both arms at the same time and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,219,220,540,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lying-one-arm-lateral-raise',1,'7.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Male/m/165_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Male/m/165_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Female/m/165_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Female/m/165_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (153,'Lying Rear Delt Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in each hand, lay with your chest down on a flat bench.</li>\r\n\r\n	<li> Position the palms of the hands in a neutral manner (palms facing your torso) as you keep the arms extended with the elbows slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arms to the side until your elbows are at shoulder height and your arms are roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arms perpendicular to the torso while keeping them extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbells to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with just one arm and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,221,222,550,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lying-rear-delt-raise',1,'9.1',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Male/m/376_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Male/m/376_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Female/m/376_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Female/m/376_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (154,'Machine Shoulder (Military) Press','\n        <p>\n        </p><p></p><ol><li> Sit down on the Shoulder Press Machine and select the weight.</li>\r\n\r\n	<li> Grab the handles to your sides as you keep the elbows bent and in line with your torso.  This will be your starting position.</li>\r\n\r\n	<li>  Now lift the handles as you exhale and you extend the arms fully.  At the top of the position make sure that you hold the contraction for a second.</li>\r\n\r\n	<li> Lower the handles slowly back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use free weights (barbells and dumbbells) to perform this exercise on a military bench.</p>\n    \n',0,223,224,560,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/machine-shoulder-military-press',2,'7.6',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Male/m/74_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Male/m/74_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Female/m/74_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Female/m/74_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (155,'One-Arm Incline Lateral Raise','\n        <p>\n        </p><p></p><ol><li>Lie down sideways on an incline bench press with a dumbbell in the hand.  Make sure the shoulder is pressing against the incline bench and the arm is lying across your body with the palm around your navel.</li>\r\n\r\n<li>Hold a dumbbell in your uppermost arm while keeping it extended in front of you parallel to the floor.  This is your starting position.</li>\r\n\r\n<li>While keeping the dumbbell parallel to the floor at all times, perform a lateral raise. Your arm should travel straight up until it is pointing at the ceiling.  <strong>Tip:</strong> Exhale as you perform this movement. Hold the dumbbell in the position and feel the contraction in the shoulders for a second.</li>\r\n\r\n<li>While inhaling lower the weight across your body back into the starting position.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n<li>Switch arms and repeat the movement.</li>\r\n</ol>\n',0,225,226,570,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-incline-lateral-raise',1,'9.2',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Male/m/170_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Male/m/170_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Female/m/170_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Female/m/170_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (156,'One-Arm Kettlebell Clean and Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle.</li>\r\n<li> Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. </li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight.</li>\r\n<li> Receive the weight overhead by returning to a squat position underneath the weight.</li>\r\n<li> Keeping the weight overhead, return to a standing position. Lower the weight to the floor to perform the next repetition.</li>\r\n</ol>\n',0,227,228,580,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-clean-and-jerk-',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (157,'One-Arm Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.</li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight. Receive the weight overhead by returning to a squat position underneath the weight. Keeping the weight overhead, return to a standing position.</li>\r\n<li> Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,229,230,590,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-jerk',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (158,'One-Arm Kettlebell Military Press To The Side','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces inward. This will be your starting position.</li>\r\n<li>  Look at the kettlebell and press it up and out until it is locked out overhead.</li>\r\n<li> Lower the kettlebell back to your shoulder under control and repeat. Make sure to contract your lat, butt, and stomach forcefully for added stability and strength. </li>\r\n</ol>\n',0,231,232,600,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-military-press-to-the-side',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Male/m/517_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Male/m/517_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Female/m/517_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Female/m/517_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (159,'One-Arm Kettlebell Para Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position. </li>\r\n<li> Hold the kettlebell with the elbow out to the side, and press it up and out until it is locked out overhead.</li>\r\n<li> Lower the kettlebell back to your shoulder under control and repeat. Make sure to contract your lat, butt, and stomach forcefully for added stability and strength. </li>\r\n</ol>\n',0,233,234,610,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-para-press-',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Male/m/523_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Male/m/523_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Female/m/523_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Female/m/523_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (160,'One-Arm Kettlebell Push Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position. </li>\r\n<li>Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight. Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,235,236,620,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-push-press',2,'9.2',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Female/m/519_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Female/m/519_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (161,'One-Arm Kettlebell Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Place a kettlebell between your feet. Bend your knees and push your butt back to get in the proper starting position.</li>\r\n<li> Look straight ahead and swing the kettlebell back between your legs.</li>\r\n<li> Immediately reverse the direction and drive through with your hips and knees, accelerating the kettlebell upward.  As the kettlebell rises to your shoulder rotate your hand and punch  straight up, using momentum to receive the weight locked out overhead. </li>\r\n</ol>\n',0,237,238,630,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-snatch',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Female/m/520_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Female/m/520_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (162,'One-Arm Kettlebell Split Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.</li> \r\n<li>Dip your body by bending the knees, keeping your torso upright. </li>\r\n<li>Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight.</li>\r\n<li> Receive the weight overhead by returning to a squat position underneath the weight, positioning one leg in front of you and one leg behind you.</li>\r\n<li> Keeping the weight overhead, return to a standing position and bring your feet together. Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,239,240,640,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-split-jerk',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Female/m/540_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Female/m/540_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (163,'One-Arm Kettlebell Split Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell  in one hand by the handle.</li>\r\n<li> Squat towards the floor, and then reverse the motion,  extending the hips, knees, and finally the ankles, to raise the kettlebell overhead.</li>\r\n<li> After fully extending the body, descend into a lunge position to receive the weights overhead, one leg forward and one leg back. Ensure you drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion.</li> <li>Return to a standing position, holding the weight overhead, and bring the feet together. Lower the weight to return to the starting position.</li>\r\n</ol>\n',0,241,242,650,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-split-snatch-',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Female/m/537_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Female/m/537_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (164,'One-Arm Side Laterals','\n        <p>\n        </p><p></p><ol><li>Pick a dumbbell and place it in one of your hands.  Your non lifting hand should be used to grab something steady such as an incline bench press.  Lean towards your lifting arm and away from the hand that is gripping the incline bench as this will allow you to keep your balance.</li>\r\n\r\n<li>Stand with a straight torso and have the dumbbell by your side at arm&acirc;&#128;&#153;s length with the palm of the hand facing you.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the dumbbell to your side with a slight bend on the elbow and your hand slightly tilted forward as if pouring water in a glass.  Continue to go up until you arm is parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n<li>Lower the dumbbell back down slowly to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n\r\n<li>Switch arms and repeat the exercise.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed sitting down.</p>\r\n\n    \n',0,243,244,660,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-side-laterals',1,'9.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Male/m/173_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Male/m/173_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Female/m/173_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Female/m/173_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (166,'Push Press','\n        <p>\n        </p><p><strong>Beginning Position:</strong></p>\r\n\r\n<p></p><ul><li>Use the floor-to-shoulder lifting technique described in the <a href=\"exercises.php?Name=Power+Clean\">Power Clean</a> exercise to move the bar from the floor to the shoulders.</li>\r\n</ul><p><strong>Upward Movement Phase:</strong></p>\r\n\r\n<p></p><ul><li>Slightly flex the hips and knees, keeping torso erect.</li>\r\n<li>Immediately follow with an explosive push upward by extending the knees.</li>\r\n<li>Keep torso erect and tensed.</li>\r\n<li>At maximum hip and knee extension, shift body weight to balls of feet and extend ankle joints.</li>\r\n<li>At maximum plantar flexion, push bar from the shoulders.</li>\r\n<li>Push the bar with the arms to a fully extended elbow position overhead.</li>\r\n</ul><p><strong>Downward Movement Phase:</strong></p>\r\n\r\n<p></p><ul><li>Lower bar to shoulders.</li>\r\n<li>Flex hips and knees slightly as bar touches shoulders.</li>\r\n<li>Straighten the hips and knees before the upward movement phase begins again.</li>\r\n</ul><p><strong>Breathing:</strong></p>\r\n\r\n<p></p><ul><li>Exhale through the sticking point of the upward movement phase.</li>\r\n<li>Inhale during the downward movement phase.</li>\r\n</ul>\n',0,245,246,680,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/push-press',2,'9.4',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (167,'Push Press - Behind the Neck','\n        <p>\n        </p><p>\r\n</p><ol><li>Standing with the weight racked on the back of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible. Drive through the heels create as much speed and force as possible, moving the bar in a vertical path.</li>\r\n<li> Using the momentum generated, finish pressing the weight overhead be extending through the arms.</li>\r\n<li> Return to the starting position, using your legs to absorb the impact. </li>\r\n</ol>\n',0,247,248,690,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/push-press-behind-the-neck',2,'7.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (168,'Rack Delivery','\n        <p>\n        </p><p>\r\n</p><ol><li>This drill teaches the delivery of the barbell to the rack position on the shoulders. Begin holding a bar in the scarecrow position, with the upper arms parallel to the floor, and the forearms hanging down. Use a hook grip, with your fingers wrapped over your thumbs.</li>\r\n<li> Begin by rotating the elbows around the bar, delivering the bar to the shoulders. As your elbows come forward, relax your grip. The shoulders should be protracted, providing a shelf for the bar, which should lightly contact the throat.</li>\r\n<li> It is important that the bar stay close to the body at all times, as with a heavier load any distance will result in an unwanted collision. As the movement becomes smoother, speed and load can be increased before progressing further. </li>\r\n</ol>\n',0,249,250,700,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/rack-delivery',2,'0.0',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (169,'Reverse Flyes','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on an incline bench with the chest and stomach pressing against the incline.  Have the dumbbells in each hand with the palms facing each other (neutral grip).</li>\r\n\r\n	<li> Extend the arms in front of you so that they are perpendicular to the angle of the bench.  The legs should be stationary while applying pressure with the ball of your toes.  This is the starting position.</li>\r\n\r\n	<li> Maintaining the slight bend of the elbows, move the weights out and away from each other (to the side) in an arc motion while exhaling. <strong>Tip:</strong> Try to squeeze your shoulder blades together to get the best results from this exercise.</li>\r\n\r\n	<li> The arms should be elevated until they are parallel to the floor.</li>\r\n\r\n	<li> Feel the contraction and slowly lower the weights back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,251,252,710,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-flyes',1,'9.2',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Male/m/375_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Male/m/375_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Female/m/375_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Female/m/375_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (170,'Reverse Flyes With External Rotation','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on an incline bench set at a 30-degree angle with the chest and stomach pressing against the incline.</li>\r\n\r\n	<li> Have the dumbbells in each hand with the palms facing down to the floor.  Your arms should be in front of you so that they are perpendicular to the angle of the bench. <strong>Tip:</strong> Your elbows should have a slight bend.  The legs should be stationary while applying pressure with the ball of your toes (your heels should not be touching the floor).  This is the starting position.</li>\r\n\r\n	<li> Maintaining the slight bend of the elbows, move the weights out and away from each other in an arc motion while exhaling.</li>\r\n\r\n	<li> As you lift the weight, your wrist should externally rotate by 90-degrees so that you go from a palms down (pronated) grip to a palms facing each other (neutral) grip. <strong>Tip:</strong> Try to squeeze your shoulder blades together to get the best results from this exercise.</li>\r\n\r\n	<li> The arms should be elevated until they are level with the head.</li>\r\n\r\n	<li> Feel the contraction and slowly lower the weights back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,253,254,720,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-flyes-with-external-rotation',1,'9.2',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Male/m/239_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Male/m/239_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Female/m/239_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Female/m/239_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (171,'Reverse Machine Flyes','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the handles so that they are fully to the rear. Make an appropriate weight selection and adjust the seat height so the handles are at shoulder level. Grasp the handles with your hands facing inwards. This will be your starting position.</li>\r\n<li> In a semicircular motion, pull your hands out to your side and back, contracting your rear delts.</li>\r\n<li> Keep your arms slightly bent throughout the movement, with all of the motion occurring at the shoulder joint.</li>\r\n<li> Pause at the rear of the movement, and slowly return the weight to the starting position.\r\n</li>\r\n</ol>\n',0,255,256,730,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-machine-flyes',1,'0.0',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Male/m/912_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Male/m/912_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Female/m/912_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Female/m/912_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (172,'Seated Barbell Military Press','\n        <p>\n        </p><p></p><ol><li> Sit on a Military Press Bench with a bar behind your head and either have a spotter give you the bar (better on the rotator cuff this way) or pick it up yourself carefully with a pronated grip (palms facing forward).  <strong>Tip:</strong> Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down.</li>\r\n\r\n	<li>  Once you pick up the barbell with the correct grip length, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the collarbone slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> This exercise can also be performed standing but those with lower back problems are better off performing this seated variety.</li>\r\n\r\n	<li> The behind the neck variation is not recommended for people with shoulder problems as it can be hard on the rotator cuff due to the hyperextension created by bringing the bar behind the neck.</li>\r\n</ul>\n',0,257,258,740,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-barbell-military-press',2,'9.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Male/m/382_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Male/m/382_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Female/m/382_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Female/m/382_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (173,'Seated Bent-Over Rear Delt Raise','\n        <p>\n        </p><p></p><ol><li> Place a couple of dumbbells looking forward in front of a flat bench.</li>\r\n\r\n	<li> Sit on the end of the bench with your legs together and the dumbbells behind your calves.</li>\r\n\r\n	<li> Bend at the waist while keeping the back straight in order to pick up the dumbbells.  The palms of your hands should be facing each other as you pick them.  This will be your starting position.</li>\r\n\r\n	<li> Keeping your torso forward and stationary, and the arms slightly bent at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor.  Exhale as you lift the weights.  (Note: avoid swinging the torso or bringing the arms back as opposed to the side.)</li>\r\n\r\n	<li> After a one second contraction at the top, slowly lower the dumbbells back to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can also be performed standing but those with lower back problems are better off performing this seated variety.</p>\n    \n',0,259,260,750,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-bent-over-rear-delt-raise',1,'9.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Male/m/377_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Male/m/377_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Female/m/377_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Female/m/377_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (174,'Seated Cable Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 90 degrees to the body, with your head and chest up. The elbows should also be bent to about 90 degrees. This will be your starting position.</li>\r\n<li> Begin by extending through the elbow, pressing the handles together above your head.</li>\r\n<li>After pausing at the top, return the handles to the starting position. Ensure that you maintain tension on the cables. </li>\r\n<li>  You can also execute this movement with your back off the pad and alternate hands.\r\n</li>\r\n</ol>\n',0,261,262,760,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-cable-shoulder-press',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Male/m/871_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Male/m/871_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Female/m/871_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Female/m/871_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (175,'Seated Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Grab a couple of dumbbells and sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs.</li>\r\n\r\n	<li> Clean the dumbbells up one at a time by using your thighs to bring the dumbbells up to shoulder height at each side.</li>\r\n\r\n	<li> Rotate the wrists so that the palms of your hands are facing forward.  This is your starting position.</li>\r\n\r\n	<li> As you exhale, push the dumbbells up until they touch at the top.</li>\r\n\r\n	<li> After a second pause, slowly come down back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> You can perform the exercise standing or sitting on a regular flat bench.  For people with lower back problems, the version described is the recommended one.</li>\r\n\r\n	<li> You can also perform the exercise as Arnold Schwarzenegger used to do it, which is to start holding the dumbbells with a supinated grip (palms facing you) in front of your shoulders and then, as you start pushing up, you align the dumbbells in the starting position described on step 3 by rotating your wrists and touch the dumbbells at the top.  As you come down, then you would go back to the starting position by rotating the wrist throughout the lowering portion until the palms of your hands are facing you.  This variation is called the Arnold Press.  However, it is not recommended if you have rotator cuff problems.</li>\r\n</ul>\n',0,263,264,770,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-dumbbell-press',2,'8.2',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Male/m/364_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Male/m/364_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Female/m/364_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Female/m/364_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (176,'Seated Side Lateral Raise','\n        <p>\n        </p><p></p><ol><li>  Pick a couple of dumbbells and sit at the end of a flat bench with your feet firmly on the floor. Hold the dumbbells with your palms facing in and your arms straight down at your sides at arms\' length.  This will be your starting position.</li>\r\n\r\n	<li>  While maintaining the torso stationary (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass.  Continue to go up until you arms are parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n	<li> Lower the dumbbells back down slowly to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed standing up.</p>\n    \n',0,265,266,780,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-side-lateral-raise',1,'8.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Male/m/378_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Male/m/378_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Female/m/378_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Female/m/378_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (177,'See-Saw Press (Alternating Side Press)','\n        <p>\n        </p><p></p><ol><li> Grab a dumbbell with each hand and stand up erect.</li>\r\n\r\n	<li> Clean (lift) the dumbbells to the chest/shoulder level and then rotate your wrists so that your palms are facing towards you as if you were getting ready to perform an Arnold Press. This will be your starting position.</li>\r\n\r\n	<li> Now start extending your left arm overhead as you rotate the wrist so that the palm of your hand faces forward as you go up.  Your elbows should come out also as you lift the weight.  Simultaneously, you will also be bending from your hip to your opposite side. <strong>Tip:</strong> If you perform the exercise correctly, is should look as if you are trying to reach for something overhead on the right hand side of your body, but with your left arm.  Breathe out as you perform this movement.</li>\r\n\r\n	<li> Once you reach the top position breathe in.  Then, with the weight fully extended overhead and you bent over to your right hand side, begin the movement to the left side.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be extremely careful with the weight used as using a weight that you cannot control can cause back injury.</p>\n    \n',0,267,268,790,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/see-saw-press-alternating-side-press',2,'7.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (178,'Shoulder Press - With Bands','\n        <p>\n        </p><p></p><ol><li>  To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles and lift them so that the hands are at shoulder height at each side.</li>\r\n\r\n	<li> Rotate the wrists so that the palms of your hands are facing forward.  Your elbows should be bent, with the upper arms and forearms in line to the torso.  This is your starting position.</li>\r\n\r\n	<li> As you exhale, lift the handles up until your arms are fully extended overhead.</li>\r\n</ol>\n',0,269,270,800,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-press-with-bands',2,'8.0',1,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Male/m/259_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Male/m/259_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Female/m/259_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Female/m/259_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (179,'Side Lateral Raise','\n        <p>\n        </p><p></p><ol><li> Pick a couple of dumbbells and stand with a straight torso and the dumbbells by your side at arms length with the palms of the hand facing you.  This will be your starting position.</li>\r\n\r\n	<li>  While maintaining the torso in a stationary position (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass.  Continue to go up until you arms are parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n	<li> Lower the dumbbells back down slowly to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can also be performed sitting down.</p>\n    \n',0,271,272,810,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/side-lateral-raise',1,'9.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Male/m/373_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Male/m/373_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Female/m/373_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Female/m/373_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (180,'Smith Incline Shoulder Raise','\n        <p>\n        </p><p></p><ol><li> Place an incline bench underneath the smith machine.  Place the barbell at a height that you can reach when lying down and your arms are almost fully extended.  Once the weight you need is selected, lie down on the incline bench and make sure your shoulders are aligned right under the barbell.</li>\r\n\r\n	<li> Using a shoulder width pronated (palms forward) grip, lift the bar from the rack and hold it straight over you with a slight bend at the elbows.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe out, lift the bar up until your arms are fully extended.  <strong>Note:</strong> The contraction should be felt around the shoulders.</li>\r\n\r\n	<li> After a second pause, bring the bar back down to the starting position as you breathe in.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with dumbbells or a barbell.</p>\n    \n',0,273,274,820,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/smith-incline-shoulder-raise',1,'0.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Male/m/329_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Male/m/329_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Female/m/329_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Female/m/329_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (181,'Smith Machine Overhead Shoulder Press','\n        <p>\n        </p><p></p><ol><li> To begin, place a flat bench (or preferably one with back support) underneath a smith machine.  Position the barbell at a height so that when seated on the flat bench, the arms must be almost fully extended to reach the barbell.</li>\r\n\r\n	<li> Once you have the correct height, sit slightly in behind the barbell so that there is an imaginary straight line from the tip of your nose to the barbell.  Your feet should be stationary.  Grab the barbell with the palms facing forward, unlock it and lift it up so that your arms are fully extended.  This is the starting position.</li>\r\n\r\n	<li> Slowly begin to lower the barbell until it is level with your chin while inhaling.</li>\r\n\r\n	<li> Then lift the barbell back to the starting position using your shoulders while exhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can use dumbbells or a barbell to perform this exercise.</p>\n    \n',0,275,276,830,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-overhead-shoulder-press',2,'8.7',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Male/m/76_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Male/m/76_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Female/m/76_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Female/m/76_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (182,'Standing Barbell Press Behind Neck','\n        <p>\n        </p><p></p><ol><li> This exercise is best performed inside a squat rack for easier pick up of the bar.  To begin, first set the bar on a rack that best matches your height.  Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.</li>\r\n\r\n	<li> Hold on to the bar using both arms at each side and lift it off the rack by first pushing with your legs and at the same time straightening your torso.</li>\r\n\r\n	<li> Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Your back should be kept straight while performing this exercise. This will be your starting position.</li>\r\n\r\n	<li> Elevate the barbell overhead by fully extending your arms while breathing out.</li>\r\n\r\n	<li> Hold the contraction for a second and lower the barbell back down to the starting position by inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Performing this exercise can cause serious injury if not performed properly.  Make sure to keep your back straight when lowering and lifting the barbell.</p>\n    \n',0,277,278,840,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-barbell-press-behind-neck',2,'7.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Male/m/381_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Male/m/381_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Female/m/381_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Female/m/381_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (183,'Standing Dumbbell Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Standing with your feet shoulder width apart, take a dumbbell in each hand. Raise the dumbbells to head height, the elbows out and about 90 degrees. This will be your starting position.</li>\r\n<li> Maintaining strict technique with no leg drive or leaning back, extend through the elbow to raise the weights together directly above your head.</li>\r\n<li> Pause, and slowly return the weight to the starting position.\r\n</li>\r\n</ol>\n',0,279,280,850,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-press-',2,'0.0',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Male/m/920_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Male/m/920_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Female/m/920_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Female/m/920_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (184,'Standing Dumbbell Straight-Arm Front Delt Raise Above Head','\n        <p>\n        </p><p></p><ol><li> Hold the dumbbells in front of your thighs, palms facing your thighs.</li>\r\n\r\n	<li>  Keep your arms straight with a slight bend at the elbows but keep them locked. This will be your starting position.</li>\r\n\r\n	<li>  Raise the dumbbells in a semicircular motion to arm\'s length overhead as you exhale.</li>\r\n\r\n	<li>  Slowly return to the starting position using the same path as you inhale.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can perform this exercise with a barbell or by alternating dumbbells.</p>\n    \n',0,281,282,860,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-straight-arm-front-delt-raise-above-head',1,'8.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Male/m/374_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Male/m/374_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Female/m/374_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Female/m/374_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (185,'Standing Front Barbell Raise Over Head','\n        <p>\n        </p><p></p><ol><li> To begin, stand straight with a barbell in your hands.  You should grip the bar with palms facing down and a closer than shoulder width grip apart from each other.</li>\r\n\r\n	<li> Your feet should be shoulder width apart from each other.  Your elbows should be slightly bent.  This is the starting position.</li>\r\n\r\n	<li> Lift the barbell up until it is directly over your head while exhaling.  Make sure to keep your elbows slightly bent when performing each repetition.</li>\r\n\r\n	<li> Once you feel the contraction, begin to lower the barbell back down to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed with dumbbells in each hand or by using a close or wide grip with the barbell.  By alternating the widths of your grip, you will be able to contract different parts of the shoulders for an overall better physique.</p>\n    \n',0,283,284,870,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-front-barbell-raise-over-head',1,'7.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Male/m/379_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Male/m/379_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Female/m/379_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Female/m/379_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (186,'Standing Low-Pulley Deltoid Raise','\n        <p>\n        </p><p></p><ol><li> Start by standing to the right side of a low pulley row.  Use your left hand to come across the body and grab a single handle attached to the low pulley with a pronated grip (palms facing down).  Rest your arm in front of you.  Your right hand should grab the machine for better support and balance.</li>\r\n\r\n	<li> Make sure that your back is erect and your feet are shoulder width apart from each other.  This is the starting position.</li>\r\n\r\n	<li> Begin to use the left hand and come across your body out until it is elevated to shoulder height while exhaling.</li>\r\n\r\n	<li> Feel the contraction at the top for a second and begin to slowly lower the handle back down to the original starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n\r\n	<li> Switch arms and repeat the exercise.</li>\r\n</ol>\n',0,285,286,880,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-low-pulley-deltoid-raise',1,'8.9',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Male/m/72_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Male/m/72_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Female/m/72_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Female/m/72_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (187,'Standing Military Press','\n        <p>\n        </p><p></p><ol><li> Start by placing a barbell that is about chest high on a squat rack.  Once you have selected the weights, grab the barbell using a pronated (palms facing forward) grip.  Make sure to grip the bar wider than shoulder width apart from each other.</li>\r\n\r\n	<li> Slightly bend the knees and place the barbell on your collar bone.  Lift the barbell up keeping it lying on your chest.  Take a step back and position your feet shoulder width apart from each other.</li>\r\n\r\n	<li> Once you pick up the barbell with the correct grip length, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the collarbone slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p>\r\n \r\n<p></p><ul><li> This exercise can also be performed sitting as those with lower back problems are better off performing this seated variety.</li>\r\n\r\n	<li> The behind the neck variation is not recommended for people with shoulder problems as it can be hard on the rotator cuff due to the hyperextension created by bringing the bar behind the neck.</li>\r\n\r\n	<li> Another option is to use dumbbells when performing this exercise for better isolation.</li>\r\n</ul>\n',0,287,288,890,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-military-press',2,'9.1',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Male/m/370_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Male/m/370_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Female/m/370_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Female/m/370_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (188,'Standing Palm-In One-Arm Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Start by having a dumbbell in one hand with your arm fully extended to the side using a neutral grip. Use your other arm to hold on to an incline bench to keep your balance.</li>\r\n\r\n	<li> Your feet should be shoulder width apart from each other.  Now slowly lift the dumbbell up until you create a 90 degree angle with your arm. <strong>Note:</strong> Your forearm should be perpendicular to the floor.  Continue to maintain a neutral grip throughout the entire exercise.</li>\r\n\r\n	<li> Slowly lift the dumbbell up until your arm is fully extended.  This the starting position.</li>\r\n\r\n	<li> While inhaling lower the weight down until your arm is at a 90 degree angle again.</li>\r\n\r\n	<li> Feel the contraction for a second and then lift the weight back up towards the starting position while exhaling.  Remember to hold on to the incline bench and keep your feet positioned to keep balance during the exercise.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n\r\n	<li> Switch arms and repeat the exercise.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can be performed with dumbbells in each arm as the dumbbells will help to keep you balanced.  This is another great way to add variety to your routines and keep them interesting.</p>\n    \n',0,289,290,900,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-palm-in-one-arm-dumbbell-press',2,'9.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Male/m/366_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Male/m/366_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Female/m/366_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Female/m/366_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (189,'Standing Palms-In Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Start by having a dumbbell in each hand with your arm fully extended to the side using a neutral grip. Your feet should be shoulder width apart from each other.  Now slowly lift the dumbbells up until you create a 90 degree angle with your arms. <strong>Note:</strong> Your forearms should be perpendicular to the floor. This the starting position.</li>\r\n\r\n	<li> Continue to maintain a neutral grip throughout the entire exercise.  Slowly lift the dumbbells up until your arms are fully extended.  </li>\r\n\r\n	<li> While inhaling lower the weights down until your arm is at a 90 degree angle again.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can be performed with a dumbbell in one arm and another holding on to an incline bench.  This is another great way to add variety to your routines and keep them interesting.</p>\n    \n',0,291,292,910,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-palms-in-dumbbell-press',2,'0.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Male/m/367_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Male/m/367_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Female/m/367_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Female/m/367_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (190,'Two-Arm Kettlebell Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean the kettlebells to your shoulders by extending through the legs and hips as you raise the kettlebells towards your shoulders. Rotate your wrists as you do so. </li>\r\n<li> Lower the kettlebells back to the starting position and repeat.</li>\r\n</ol>\n',0,293,294,920,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-clean',2,'0.0',2,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Male/m/529_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Male/m/529_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Female/m/529_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Female/m/529_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (191,'Two-Arm Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. Squat down a few inches and reverse the motion rapidly driving both kettlebells overhead. Immediately after the initial push, squat down again and get under the kettlebells. Once the kettlebells are locked out, stand upright to complete the exercise.\r\n\n    </li></ol>\n',0,295,296,930,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-jerk',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Male/m/528_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Male/m/528_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Female/m/528_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Female/m/528_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (192,'Two-Arm Kettlebell Military Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward.</li>\r\n<li>  Press the kettlebells up and out. As the kettlebells pass your head, lean into the weights so that the kettlebells are racked behind your head. Make sure to contract your lats, butt, and stomach for added stability. </li>\r\n</ol>\n',0,297,298,940,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-military-press',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Male/m/530_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Male/m/530_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Female/m/530_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Female/m/530_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (193,'Upright Barbell Row','\n        <p>\n        </p><p></p><ol><li>Grasp a barbell with an overhand grip that is slightly less than shoulder width.  The bar should be resting on the top of your thighs with your arms extended and a slight bend in your elbows.  Your back should also be straight.  This will be your starting position.</li>\r\n\r\n<li>Now exhale and use the sides of your shoulders to lift the bar, raising your elbows up and to the side.  Keep the bar close to your body as you raise it.  Continue to lift the bar until it nearly touches your chin. Tip: Your elbows should drive the motion, and should always be higher than your forearms.  Remember to keep your torso stationary and pause for a second at the top of the movement.</li> \r\n\r\n<li>Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using dumbbells, though this later exercise should be reserved by people that are well familiarized with correct execution.</p>\n    \n',0,299,300,950,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/upright-barbell-row',2,'8.8',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Male/m/365_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Male/m/365_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Female/m/365_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Female/m/365_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (194,'Shoulders','',0,374,379,4,1,66,'',0,'0.0',0,0,'',''),
 (195,'Backward Medicine Ball Throw','\n        <p>\n        </p><p>\r\n</p><ol><li>This exercise is best done with a partner. If you lack a partner, the ball can be thrown and retrieved or thrown against a wall.</li>\r\n<li> Begin standing a few meters in front of your partner, both facing the same direction. Begin holding the ball between your legs.</li>\r\n<li> Squat down and then forcefully reverse direction, coming to full extension and you toss the ball over your head to your partner.</li>\r\n<li> Your partner can then roll the ball back to you. Repeat for the desired number of repetitions.\r\n</li>\r\n</ol>\n',0,375,376,10,2,194,'http://www.bodybuilding.com/exercises/detail/view/name/backward-medicine-ball-throw',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Male/m/764_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Male/m/764_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Female/m/764_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Female/m/764_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (196,'Return Push from Stance','\n        <p>\n        </p><p>\r\n</p><ol><li>You will need a partner for this drill.</li>\r\n<li> Begin in an athletic 2 or 3 point stance.</li>\r\n<li> At the signal, move into a position to receive the pass from your partner.</li>\r\n<li> Catch the medicine ball with both hands and immediately throw it back to your partner.</li>\r\n<li> You can modify this drill by running different routes.\r\n</li>\r\n</ol>\n',0,377,378,20,2,194,'http://www.bodybuilding.com/exercises/detail/view/name/return-push-from-stance',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (197,'Chest','',0,380,381,5,1,66,'',0,'0.0',0,0,'','');
